
import base64
import os

# Du lieu da ma hoa
DATA_B64 = ""

def save(filename="code_ve_may.py"):
    try:
        decoded = base64.b64decode(DATA_B64).decode("utf-8")
        with open(filename, "w", encoding="utf-8") as f:
            f.write(decoded)
        print(f"SUCCESS: Da giai nen code vao file: {filename}")
        print(f"Thu muc hien tai: {os.getcwd()}")
    except Exception as e:
        print(f"ERROR: {e}")
